PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "django_migrations" ("id" integer NOT NULL PRIMARY KEY AUTO_INCREMENT, "app" varchar(255) NOT NULL, "name" varchar(255) NOT NULL, "applied" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "django_admin_log" ("id" integer NOT NULL PRIMARY KEY AUTO_INCREMENT, "action_time" datetime NOT NULL, "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "change_message" text NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NOT NULL REFERENCES "Landing_user" ("id") DEFERRABLE INITIALLY DEFERRED, "action_flag" smallint unsigned NOT NULL CHECK ("action_flag" >= 0));
CREATE TABLE IF NOT EXISTS "django_content_type" ("id" integer NOT NULL PRIMARY KEY AUTO_INCREMENT, "app_label" varchar(100) NOT NULL, "model" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group_permissions" ("id" integer NOT NULL PRIMARY KEY AUTO_INCREMENT, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_permission" ("id" integer NOT NULL PRIMARY KEY AUTO_INCREMENT, "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "codename" varchar(100) NOT NULL, "name" varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group" ("id" integer NOT NULL PRIMARY KEY AUTO_INCREMENT, "name" varchar(150) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "Landing_user_groups" ("id" integer NOT NULL PRIMARY KEY AUTO_INCREMENT, "user_id" integer NOT NULL REFERENCES "Landing_user" ("id") DEFERRABLE INITIALLY DEFERRED, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "Landing_user_user_permissions" ("id" integer NOT NULL PRIMARY KEY AUTO_INCREMENT, "user_id" integer NOT NULL REFERENCES "Landing_user" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "account_emailconfirmation" ("id" integer NOT NULL PRIMARY KEY AUTO_INCREMENT, "created" datetime NOT NULL, "sent" datetime NULL, "key" varchar(64) NOT NULL UNIQUE, "email_address_id" integer NOT NULL REFERENCES "account_emailaddress" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "account_emailaddress" ("id" integer NOT NULL PRIMARY KEY AUTO_INCREMENT, "verified" bool NOT NULL, "primary" bool NOT NULL, "user_id" integer NOT NULL REFERENCES "Landing_user" ("id") DEFERRABLE INITIALLY DEFERRED, "email" varchar(254) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "django_site" ("id" integer NOT NULL PRIMARY KEY AUTO_INCREMENT, "name" varchar(50) NOT NULL, "domain" varchar(100) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "socialaccount_socialapp_sites" ("id" integer NOT NULL PRIMARY KEY AUTO_INCREMENT, "socialapp_id" integer NOT NULL REFERENCES "socialaccount_socialapp" ("id") DEFERRABLE INITIALLY DEFERRED, "site_id" integer NOT NULL REFERENCES "django_site" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "socialaccount_socialtoken" ("id" integer NOT NULL PRIMARY KEY AUTO_INCREMENT, "token" text NOT NULL, "token_secret" text NOT NULL, "expires_at" datetime NULL, "account_id" integer NOT NULL REFERENCES "socialaccount_socialaccount" ("id") DEFERRABLE INITIALLY DEFERRED, "app_id" integer NOT NULL REFERENCES "socialaccount_socialapp" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "socialaccount_socialapp" ("id" integer NOT NULL PRIMARY KEY AUTO_INCREMENT, "provider" varchar(30) NOT NULL, "name" varchar(40) NOT NULL, "client_id" varchar(191) NOT NULL, "key" varchar(191) NOT NULL, "secret" varchar(191) NOT NULL);
CREATE TABLE IF NOT EXISTS "socialaccount_socialaccount" ("id" integer NOT NULL PRIMARY KEY AUTO_INCREMENT, "provider" varchar(30) NOT NULL, "uid" varchar(191) NOT NULL, "last_login" datetime NOT NULL, "date_joined" datetime NOT NULL, "user_id" integer NOT NULL REFERENCES "Landing_user" ("id") DEFERRABLE INITIALLY DEFERRED, "extra_data" text NOT NULL);
CREATE TABLE IF NOT EXISTS "Landing_user" ("id" integer NOT NULL PRIMARY KEY AUTO_INCREMENT, "password" varchar(128) NOT NULL, "last_login" datetime NULL, "username" varchar(40) NOT NULL UNIQUE, "first_name" varchar(40) NOT NULL, "last_name" varchar(40) NOT NULL, "email" varchar(254) NOT NULL, "is_business" bool NOT NULL, "is_staff" bool NOT NULL, "is_superuser" bool NOT NULL);
CREATE TABLE IF NOT EXISTS "Landing_capacity" ("id" integer NOT NULL PRIMARY KEY AUTO_INCREMENT, "numReviews" integer NOT NULL, "average" real NOT NULL, "business" varchar(40) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "Landing_waittimes" ("id" integer NOT NULL PRIMARY KEY AUTO_INCREMENT, "numReviews" integer NOT NULL, "average" real NOT NULL, "business" varchar(40) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "Landing_staff_profile" ("id" integer NOT NULL PRIMARY KEY AUTO_INCREMENT, "staffof_id" integer NOT NULL UNIQUE REFERENCES "Landing_business" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NOT NULL UNIQUE REFERENCES "Landing_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "Landing_business_profile" ("id" integer NOT NULL PRIMARY KEY AUTO_INCREMENT, "user_id" integer NOT NULL UNIQUE REFERENCES "Landing_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "Landing_business_profile_businesses" ("id" integer NOT NULL PRIMARY KEY AUTO_INCREMENT, "business_profile_id" integer NOT NULL REFERENCES "Landing_business_profile" ("id") DEFERRABLE INITIALLY DEFERRED, "business_id" integer NOT NULL REFERENCES "Landing_business" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "Landing_capacitydata" ("id" integer NOT NULL PRIMARY KEY AUTO_INCREMENT, "business" varchar(40) NOT NULL, "capacity" real NOT NULL, "author" varchar(20) NOT NULL, "timestamp" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "Landing_temp_business" ("id" integer NOT NULL PRIMARY KEY AUTO_INCREMENT, "lat" real NOT NULL, "lon" real NOT NULL, "verified" bool NOT NULL, "cached_time" datetime NOT NULL, "capacity_id" integer NULL UNIQUE REFERENCES "Landing_capacity" ("id") DEFERRABLE INITIALLY DEFERRED, "wait_time_id" integer NULL UNIQUE REFERENCES "Landing_waittimes" ("id") DEFERRABLE INITIALLY DEFERRED, "placeID" text NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "Landing_waitdata" ("id" integer NOT NULL PRIMARY KEY AUTO_INCREMENT, "business" varchar(40) NOT NULL, "wait_time" real NOT NULL, "author" varchar(20) NOT NULL, "timestamp" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "Landing_business" ("id" integer NOT NULL PRIMARY KEY AUTO_INCREMENT, "name" varchar(40) NOT NULL UNIQUE, "xcor" real NOT NULL, "ycor" real NOT NULL, "verified" bool NOT NULL, "capacity_id" integer NULL UNIQUE REFERENCES "Landing_capacity" ("id") DEFERRABLE INITIALLY DEFERRED, "wait_time_id" integer NULL UNIQUE REFERENCES "Landing_waittimes" ("id") DEFERRABLE INITIALLY DEFERRED, "placeID" text NOT NULL UNIQUE, "allows_skips" bool NOT NULL);
CREATE TABLE IF NOT EXISTS "Landing_profile_all_capacity_updates" ("id" integer NOT NULL PRIMARY KEY AUTO_INCREMENT, "profile_id" integer NOT NULL REFERENCES "Landing_profile" ("id") DEFERRABLE INITIALLY DEFERRED, "capacitydata_id" integer NOT NULL REFERENCES "Landing_capacitydata" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "Landing_profile_all_time_updates" ("id" integer NOT NULL PRIMARY KEY AUTO_INCREMENT, "profile_id" integer NOT NULL REFERENCES "Landing_profile" ("id") DEFERRABLE INITIALLY DEFERRED, "waitdata_id" integer NOT NULL REFERENCES "Landing_waitdata" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "Landing_profile" ("id" integer NOT NULL PRIMARY KEY AUTO_INCREMENT, "latitude" integer NULL, "longitude" integer NULL, "birth_date" date NULL, "favorite_businesses" text NULL, "user_id" integer NOT NULL UNIQUE REFERENCES "Landing_user" ("id") DEFERRABLE INITIALLY DEFERRED, "last_capacity_update_id" integer NULL UNIQUE REFERENCES "Landing_capacitydata" ("id") DEFERRABLE INITIALLY DEFERRED, "last_time_update_id" integer NULL UNIQUE REFERENCES "Landing_waitdata" ("id") DEFERRABLE INITIALLY DEFERRED, "profile_pic" varchar(100) NULL, "skip_count" integer NOT NULL, "skip_history" text NULL, "subscription_type" varchar(10) NOT NULL, "search_history" text NULL);
